import React from 'react';
import Friend from './Frend/Friend';
import s from './Friends.module.css';

const Friends = (props) => {
    return (
        (<div>
        <div className = {s.item}>
        My friends
    </div>
    <Friend img = 'https://wl-adme.cf.tsp.li/resize/728x/jpg/214/dda/5fae555a5a94a24fd073a9a423.jpg' name = 'Yulia'/>
    <Friend img = 'https://screenfiction.org/content/image/0/5/184/924b45fd-full.webp' name = 'Alex'/>
    <Friend img = 'https://vokrug.tv/pic/news/4/4/c/3/44c38d9dcf7a066c791136b5e66e4c30.jpg' name = 'Kira'/>
    </div>
    )
    );
}

export default Friends;
